import React from 'react';

const FieldsViewer=({label, handleChange, type="text"})=>{
    
    if(type==="color")
    {
        var element = document.getElementById(label);
        element.handleChange;
    }
    return(
        <div>
           <label>{label}:</label>
           <input
                required
                type={type}
                onChange={handleChange}
                >          
           </input>
        </div>
    );
        
    

}

export default FieldsViewer;
